import React from 'react';
import './Style.css';

function Service({ title, description, iconName }) {
  return (
    <div className={`service service-${iconName}`}>
      <div className="icon-container">
        {/* Replace the placeholder icon with actual icons */}
        <i className={`icon icon-${iconName}`}>Icon</i>
      </div>
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
}

export default Service;
